?><p style="font-family: Arial, Verdana, sans-serif; font-size: 12px; text-align: justify;"><span style="color: #333333; font-family: Arial; text-align: left;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта немецкая компания специализируется на производстве высококачественных часов, которые собираются с использованием самых современных и инновационных немецких технологий. Интересно, что абсолютно все механизмы и детали для своих часов, компания Temption изготавливает сама. Часы Temption собираются исключительно вручную. За год своей деятельности, компания выпускает около 700 эксклюзивных моделей, которые так ценят многочисленные коллекционеры часов со всего мира. Но не только из-за своей ограниченности популярна эта марка часов. Основатель компании Клаус Улбрих утверждает, что такой аксессуар, как часы, обязательно должен подчеркивать индивидуальность каждого человека, а не являться его «визитной карточкой» (кстати, Клаус Улбрих также является и разработчиком и дизайнером в своей компании). Стоит отметить, что главная концепция компании основывается на одном из древнейших японских учений философия Ваби Саби. Для того, чтобы ее понять, достаточно единожды взглянуть хотя бы на одну модель часов Temption. Это простота, сочетающая в себе и ассиметрию, и различные природные процессы, и неровность всех линий. В ассортименте компании присутствуют и мужские, и женские модели наручных часов. Но, независимо от этого, каждая модель по-своему уникальна. В каждом экземпляре присутствуют те или иные функции, различные дизайнерские решения. А некоторые модели еще и водонепроницаемы до 200 метров. Часы Temption отлично подойдут людям, которые воспринимают часы не только как показатель времени, но и как аксессуар, элегантно подчеркивающий их индивидуальность.</span></span></span></p>
